CREATE TABLE roadtrips 
(
    id SERIAL PRIMARY KEY,
    name VARCHAR(100) NOT NULL
);


CREATE TABLE cities 
(
    id	INT PRIMARY KEY,
    name	VARCHAR(512),
    country_code	VARCHAR(512),
    country_name	VARCHAR(512),
    admin_code	VARCHAR(512),
    population	INT,
    elevation	INT,
    timezone	VARCHAR(512),
    latitude	DECIMAL,
    longitude	DECIMAL
);



CREATE TABLE roadtrip_cities (
    id SERIAL PRIMARY KEY,
    roadtrip_id INTEGER REFERENCES roadtrips(id) ON DELETE CASCADE,
    city_id INTEGER REFERENCES cities(id) ON DELETE CASCADE,
    position INTEGER NOT NULL,
    UNIQUE(roadtrip_id, city_id),
    UNIQUE(roadtrip_id, position)
);


CREATE TABLE weather_guides 
(
    id INT PRIMARY KEY,
    description VARCHAR(100) NOT NULL,
    advice TEXT NOT NULL
);

