INSERT INTO weather_guides (id, description, advice) VALUES 
	(200,'Thunderstorm with light rain','Carry an umbrella and wear waterproof shoes. Be cautious of sudden lightning and find shelter if the storm intensifies.'),
	(201,'Thunderstorm with rain','It''s best to stay indoors during the storm. If you must go out, wear waterproof clothing and avoid open areas.'),
	(202,'Thunderstorm with heavy rain','Avoid going outside if possible. Heavy rain and thunderstorms can cause flash flooding and dangerous conditions.'),
	(210,'Light thunderstorm','A light thunderstorm may still produce lightning. Stay indoors or seek shelter until it passes.'),
	(211,'Thunderstorm','Stay indoors and avoid using electronic devices. Thunderstorms can be dangerous due to lightning.'),
	(212,'Heavy thunderstorm','Heavy thunderstorms can be hazardous. Stay indoors and avoid windows. Be prepared for possible power outages.'),
	(221,'Ragged thunderstorm','Ragged thunderstorms can be unpredictable. Seek shelter and stay indoors until the storm passes.'),
	(230,'Thunderstorm with light drizzle','Carry a light raincoat or umbrella. Although the rain is light, lightning can still pose a risk.'),
	(231,'Thunderstorm with drizzle','Stay cautious of lightning and find shelter. Drizzle can still make surfaces slippery.'),
	(232,'Thunderstorm with heavy drizzle','Heavy drizzle with a thunderstorm can be dangerous. Seek indoor shelter and avoid travel if possible.'),
	(300,'Light intensity drizzle','A light drizzle won''t cause much disruption. A light jacket or umbrella should be enough.'),
	(301,'Drizzle','Drizzle can make roads and sidewalks slippery. Wear appropriate footwear and carry an umbrella.'),
	(302,'Heavy intensity drizzle','Heavy drizzle can be persistent and annoying. Use waterproof clothing and be prepared for damp conditions.'),
	(310,'Light intensity drizzle rain','Light drizzle rain is manageable with an umbrella or a raincoat. Watch for slippery surfaces.'),
	(311,'Drizzle rain','Drizzle rain can be persistent. Keep an umbrella handy and wear waterproof shoes.'),
	(312,'Heavy intensity drizzle rain','Heavy drizzle rain can be quite wet. Use waterproof gear and avoid prolonged exposure.'),
	(313,'Shower rain and drizzle','Shower rain mixed with drizzle can be unpredictable. Carry an umbrella and wear waterproof clothing.'),
	(314,'Heavy shower rain and drizzle','Heavy showers with drizzle require strong waterproof protection. Consider postponing outdoor activities.'),
	(321,'Shower drizzle','Shower drizzle can be intermittent. Keep an umbrella close by and be prepared for sudden showers.'),
	(500,'Light rain','Light rain is usually manageable with an umbrella or raincoat. Watch for slippery surfaces.'),
	(501,'Moderate rain','Moderate rain requires an umbrella and possibly waterproof shoes. Plan for delays if traveling.'),
	(502,'Heavy intensity rain','Heavy rain can cause flooding. Avoid unnecessary travel and stay indoors if possible.'),
	(503,'Very heavy rain','Very heavy rain is dangerous. Seek shelter, avoid driving, and be prepared for potential flooding.'),
	(504,'Extreme rain','Extreme rain can lead to severe flooding and dangerous conditions. Stay indoors and follow weather advisories.'),
	(511,'Freezing rain','Freezing rain creates hazardous ice. Avoid travel, stay indoors, and be cautious of falling ice.'),
	(520,'Light intensity shower rain','Light shower rain is usually brief. An umbrella should be sufficient protection.'),
	(521,'Shower rain','Shower rain can be intermittent. Carry an umbrella and be prepared for sudden downpours.'),
	(522,'Heavy intensity shower rain','Heavy shower rain can cause flooding. Stay indoors if possible and avoid low-lying areas.'),
	(531,'Ragged shower rain','Ragged showers can be unpredictable. Stay prepared with waterproof clothing and avoid exposed areas.'),
	(600,'Light snow','Light snow can be beautiful but slippery. Wear warm clothing and appropriate footwear.'),
	(601,'Snow','Snow can affect travel. Dress warmly and allow extra time for commuting.'),
	(602,'Heavy snow','Heavy snow can disrupt travel and cause dangerous conditions. Avoid unnecessary travel and stay indoors.'),
	(611,'Sleet','Sleet can make surfaces extremely slippery. Avoid travel if possible and be very cautious outside.'),
	(612,'Light shower sleet','Light sleet showers can be slippery. Wear appropriate footwear and move carefully.'),
	(613,'Shower sleet','Shower sleet can create hazardous conditions. Avoid travel and stay indoors if possible.'),
	(615,'Light rain and snow','Light rain and snow can create slushy conditions. Wear waterproof and warm clothing.'),
	(616,'Rain and snow','Rain mixed with snow can be very slippery. Dress warmly and use caution when traveling.'),
	(620,'Light shower snow','Light snow showers can be manageable with warm clothing and careful movement.'),
	(621,'Shower snow','Snow showers can reduce visibility. Wear warm clothes and be cautious while traveling.'),
	(622,'Heavy shower snow','Heavy snow showers can create hazardous conditions. Avoid travel if possible and stay warm.'),
	(701,'Mist','Mist can reduce visibility. Use lights if driving and move cautiously.'),
	(711,'Smoke','Smoke can affect air quality. Wear a mask if outdoors and limit physical exertion.'),
	(721,'Haze','Haze can reduce visibility. Wear a mask if air quality is poor and stay indoors if possible.'),
	(731,'Sand/dust whirls','Sand and dust whirls can be harmful. Wear a mask and protect your eyes if outdoors.'),
	(741,'Fog','Fog greatly reduces visibility. Use fog lights if driving and move slowly and carefully.'),
	(751,'Sand','Sand can be abrasive. Wear protective clothing and goggles if exposed to sandstorms.'),
	(761,'Dust','Dust can reduce air quality. Wear a mask and limit outdoor activities if possible.'),
	(762,'Volcanic ash','Volcanic ash is hazardous. Stay indoors, wear a mask, and follow local advisories.'),
	(771,'Squalls','Squalls can bring sudden, intense weather changes. Seek shelter immediately and stay indoors.'),
	(781,'Tornado','Tornadoes are extremely dangerous. Seek shelter in a basement or interior room away from windows.'),
	(800,'Clear sky','Clear skies are perfect for outdoor activities. Remember to wear sunscreen and stay hydrated.'),
	(801,'Few clouds: 11-25%','A few clouds shouldn''t affect plans. Enjoy your day but keep an eye on the weather.'),
	(802,'Scattered clouds: 25-50%','Scattered clouds can provide some shade. It''s generally good weather for outdoor activities.'),
	(803,'Broken clouds: 51-84%','Broken clouds may bring occasional shade. Be prepared for changes in weather conditions.'),
	(804,'Overcast clouds: 85-100%','Overcast skies can be gloomy but generally not disruptive. Dress appropriately for cooler weather.');